import './SocialMediaIcons.css';

function SocialMediaIcons() {
  return (
    <ul className='social-media-icons list-opacity-animation'>
      <li><a href='https://www.linkedin.com/in/francismaria/' rel='noreferrer' target='_blank'><i className="fab fa-linkedin-in"></i></a></li>
      <li><a href='https://github.com/francismaria' rel='noreferrer' target='_blank'><i className="fab fa-github"></i></a></li>
      <li><a href='https://medium.com/@francismariafms' rel='noreferrer' target='_blank'><i className="fab fa-medium-m"></i></a></li>
      <li><a href='mailto:franciscomaria97@hotmail.com' rel='noreferrer' target='_blank'><i className="fas fa-envelope"></i></a></li>
    </ul>
  );
}

export default SocialMediaIcons;
